        public void AddBoatAccess()
        {

            GameLocation beach = Game1.getLocationFromName("Beach");

            foreach (TileSheet tilesheet in beach.map.TileSheets)
            {

                //if(tilesheet.ImageSource == Game1.currentSeason.ToString() + "_beach")
                if (tilesheet.ImageSource.Contains("beach"))
                {

                    Layer beachFront = beach.map.GetLayer("Front");

                    beachFront.Tiles[92, 8] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 294);

                    beachFront.Tiles[93, 8] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 295);

                    beachFront.Tiles[94, 8] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 296);

                    beachFront.Tiles[92, 9] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 311);

                    beachFront.Tiles[93, 9] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 312);

                    beachFront.Tiles[94, 9] = new StaticTile(beachFront, tilesheet, BlendMode.Alpha, 313);


                }

            }

            foreach (Warp warp in beach.warps)
            {

                if(warp.X == 93 && warp.Y == 8)
                {

                    return;

                }

            }

            // Beach warps
            beach.warps.Add(new Warp(93, 8, LocationData.druid_atoll_name, 14, 10, flipFarmer: false));

            beach.warps.Add(new Warp(93, 9, LocationData.druid_atoll_name, 14, 10, flipFarmer: false));

            beach.warps.Add(new Warp(93, 10, LocationData.druid_atoll_name, 14, 10, flipFarmer: false));


        }

