        public override void updateWarps()
        {

            if (warpSets.Count > 0)
            {

                warps.Clear();

                foreach (WarpTile warpSet in warpSets)
                {

                    warps.Add(new Warp(warpSet.enterX, warpSet.enterY, warpSet.location, warpSet.exitX, warpSet.exitY, flipFarmer: false));

                }

                return;

            }

            warpSets.Add(new WarpTile(9, 11, "Beach", 91, 9));

            warpSets.Add(new WarpTile(10, 11, "Beach", 91, 9));

            warpSets.Add(new WarpTile(11, 11, "Beach", 91, 9));

            warpSets.Add(new WarpTile(9, 10, "Beach", 91, 9));

            warpSets.Add(new WarpTile(10, 10, "Beach", 91, 9));

            warpSets.Add(new WarpTile(11, 10, "Beach", 91, 9));

            warps.Add(new Warp(9, 11, "Beach", 91, 9, flipFarmer: false));

            warps.Add(new Warp(10, 11, "Beach", 91, 9, flipFarmer: false));

            warps.Add(new Warp(11, 11, "Beach", 91, 9, flipFarmer: false));

            warps.Add(new Warp(9, 10, "Beach", 91, 9, flipFarmer: false));

            warps.Add(new Warp(10, 10, "Beach", 91, 9, flipFarmer: false));

            warps.Add(new Warp(11, 10, "Beach", 91, 9, flipFarmer: false));
        }
